import React from 'react';
import {Navbar} from 'react-bootstrap';
import './Nav.css';
function Nav() {
    return (
        <div>
        <Navbar bg="dark" variant="dark">
            <Navbar.Brand>
            <img className="nav_logo" src="https://i1.wp.com/hrnxt.com/wp-content/uploads/2021/02/Newton-School-1.png" alt=""/>
                <span className="nav_title">Newton School</span>
            </Navbar.Brand>
        </Navbar>
        </div>
        
    )
}

export default Nav
